int press_mode = 0;
char chTime[5];
char chMoney[5];
int Time[2] = {0,0};
int TimeCount = 0; // use to make age, health, clean rate
int hunger_rate = 20;
int age_rate = 0;
int health_rate = 20;
int food1_num = 3;
int food2_num = 3;
int food3_num = 3;
int cloth1_num = 3;
int cloth2_num = 3;
int cloth3_num = 3;
int money = 50;
int heal_num = 0;
bool isDie = false;

void checkDie(WM_MESSAGE * pMsg)
{
	WM_HWIN hItem;
	if(health_rate<=0 || hunger_rate<=0)
	{
		isDie = true;
		if(heal_num>3)
		{
			hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_0);
			TEXT_SetText(hItem, "Guo-Dong Die Forever");
		}	
		else
		{
			hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_0);
			TEXT_SetText(hItem, "Guo-Dong Die QQ");
		}
	}
	else 
	{
		hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_0);
		TEXT_SetText(hItem, "Guo-Dong A Tamagotchi");
	}
}
