WM_HWIN CreatemenuWin(void);
WM_HWIN CreatemenuWin(void) {
  WM_HWIN hWin;

  hWin = GUI_CreateDialogBox(_aDialogCreate, GUI_COUNTOF(_aDialogCreate), _cbDialog, WM_HBKWIN, 0, 0);
	WM_CreateTimer(WM_GetClientWindow(hWin), 0, 1000, 0);
  return hWin;
}

// USER START (Optionally insert additional public code)
void reduceHealth(int count)
{
	if(count%20 == 0 && !isDie)
	{
		health_rate--;
	}
}

void reduceHunger(int count)
{
	if(count%10 == 0 && !isDie)
	{
		hunger_rate--;
	}
}

void increaseAge(int count)
{
	if(count%60 == 0 && !isDie)
	{
		age_rate++;
	}
}

